import React, {Component} from 'react';
import './style/nav.css';

class Nav extends Component{
    render(){
        return(
          <div className="sidebar active">
             <h1>Hola</h1>
          </div>
        )
    }


    btnActive(){
        let sidebar   = document.querySelector(".sidebar");
        sidebar.classList.toggle("active");
    }

    btnSearch(){
        let sidebar   = document.querySelector(".sidebar");
        sidebar.classList.toggle("active"); 
    }

}

export default Nav;
